import React from 'react'
import { Navbar, Nav, Form } from "react-bootstrap";
import {Link} from 'react-router-dom'
import {useState} from 'react'
import logi from '.././logi.png'

import './dash.css'


 const  Bar = ({movie}) => {
    const [sug, setSug] = useState([])

 const chage = (e) => {

      setSug(
        e.target.value
      );

  };


    return (
        <div className="all">


          <Navbar className="" variant="dark">
            <Navbar.Brand >
              <img src={logi} className="logi " alt="logi" />
            </Navbar.Brand>

            <Form  className="mx-auto">
              <input onChange={chage}
                type="text"
                className="serch"
                id="ava-serch"
                placeholder="Search"
              />
            </Form>



          </Navbar>

          {movie.filter((x) => x.title).map((el) => (
              <div key={el.id}>
                <div id="serch-drop">
                  <img src={el.poster} alt="tv" className="serch-img  " />
                  <h2 className="serch-tit">{el.title}</h2>
                </div>

              </div>
            ))} 
        </div>
      );
}

export default Bar
